void lenet5::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst_n\" :  \"" << ap_rst_n.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"img_in_TDATA\" :  \"" << img_in_TDATA.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"img_in_TVALID\" :  \"" << img_in_TVALID.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"img_in_TREADY\" :  \"" << img_in_TREADY.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"img_in_TKEEP\" :  \"" << img_in_TKEEP.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"img_in_TLAST\" :  \"" << img_in_TLAST.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"img_in_TUSER\" :  \"" << img_in_TUSER.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"result_V\" :  \"" << result_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"result_V_ap_vld\" :  \"" << result_V_ap_vld.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"enable_V\" :  \"" << enable_V.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"clear_V\" :  \"" << clear_V.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

